local color_t_new = function(r, g, b, a)
    a = a or 1
    return color_t(math.floor(r*255), math.floor(g*255), math.floor(b*255), math.floor(math.max(math.min(a*255, 255), 0)))
end
local function deg_to_rad(val) 
	return val * (math.pi / 180.0) 
end
local vector_length_2d = function(Forward)
	return math.sqrt(Forward.x * Forward.x + Forward.y * Forward.y)
end
local function angle_to_vector(Angle)
	local cp, sp = math.cos(deg_to_rad(Angle.x)), math.sin(deg_to_rad(Angle.x))
	local cy, sy = math.cos(deg_to_rad(Angle.y)), math.sin(deg_to_rad(Angle.y))
	local cr, sr = math.cos(deg_to_rad(Angle.z)), math.sin(deg_to_rad(Angle.z))

	local forward = vec3_t(0, 0, 0)

	forward.x = cp * cy
	forward.y = cp * sy
	forward.z = -sp

	return forward
end
local function vector_to_angle(Forward)
	local Temp = 0
	local Yaw = 0
	local Pitch = 0
	if Forward.y == 0 and Forward.x == 0 then
		Yaw = 0
		if Forward.z > 0 then
			Pitch = 270
		else
			Pitch = 90
		end
	else
		Yaw = math.atan2(Forward.y, Forward.x) * 180 / math.pi
		if Yaw < 0 then
			Yaw = Yaw + 360
		end
		Temp = math.sqrt(Forward.x * Forward.x + Forward.y * Forward.y)
		Pitch = math.atan2(-Forward.z, Temp) * 180 / math.pi
		if Pitch < 0 then
			Pitch = Pitch + 360
		end
	end
	return angle_t(Pitch, Yaw, 0)
end
