     normalizeangles = function(self, ang)
          if(ang.x > 180.0) then ang.x = ang.x - 360.0 end
          if(ang.y > 180.0) then ang.y = ang.y - 360.0 end
          return ang
     end,

     normalizefloat = function(self, ang)
          if(ang > 180.0) then ang = ang - 360.0 end
          if(ang < -180.0) then ang = ang + 360.0 end
          return ang
     end,

     calcangle = function(self, src, dst)
          local vecdelta = vec3_t(dst.x - src.x, dst.y - src.y, dst.z - src.z)
          local angles = angle_t(math.atan2(-vecdelta.z, vector_length_2d(vecdelta)) * 180.0 / math.pi, (math.atan2(vecdelta.y, vecdelta.x) * 180.0 / math.pi), 0.0)
          return angles
     end,

     lerp = function(self, start, vend, time)
          return start + (vend - start) * time
     end,

     clamp = function(self, val, min, max)
          if(val > max) then
               val = max
          elseif(val < min) then
               val = min
          end
          return val
     end,

     pointinscreen = function(self, point)
          if(point.x > 0 and point.x < screensize.x and point.y > 0 and point.y < screensize.x) then
               return true
          else
               return false
          end
     end,

     boxinscreen = function(self, max, min)
          if(min.x > 0 and min.x < screensize.x and min.y > 0 and max.y < screensize.x and max.x > 0 and max.x < screensize.x and max.y > 0 and max.y < screensize.x) then
               return true
          else
               return false
          end
     end,

     TIME_TO_TICKS = function(self, time)
          return math.floor(time / global_vars.interval_per_tick() + 0.5) 
     end,

     TICKS_TO_TIME = function(self, tick)
          return tick * global_vars.interval_per_tick()
     end,
}
local dist_to = function(pos1, pos2)
    local dx = pos1.x - pos2.x
    local dy = pos1.y - pos2.y
    local dz = pos1.z - pos2.z

    return math.sqrt(dx * dx + dy * dy + dz * dz)
end
