     on_pre_prediction = function(self, cmd)
          self:backup_strafe(cmd)
          self:extend_forward(cmd)
          if(self.should_throw == true) then
            local pUserCmd = ffi_handler1.g_pInput.vfptr.GetUserCmd(ffi.cast("uintptr_t", ffi_handler1.g_pInput), 0, cmd.command_number)
               if(self.closest_nade.duck == true) then pUserCmd.buttons = bit.bor(pUserCmd.buttons, 4)
               else pUserCmd.buttons = bit.band(pUserCmd.buttons, bit.bnot(4)) end
          end
     end,

     on_prediction = function(self, cmd)
          self:update_configs()
          local pUserCmd = ffi_handler1.g_pInput.vfptr.GetUserCmd(ffi.cast("uintptr_t", ffi_handler1.g_pInput), 0, cmd.command_number)
          local localplayer = entity_list.get_local_player()
          if(localplayer == nil) then return end
          local velocity = vec3_t(localplayer:get_prop("m_vecVelocity[0]"), localplayer:get_prop("m_vecVelocity[1]"), localplayer:get_prop("m_vecVelocity[2]"))
          local weapon = localplayer:get_active_weapon()
          if(weapon == nil) then return end
          local throwtime = weapon:get_prop("m_fThrowTime")
          local duckamount = localplayer:get_prop("m_flDuckAmount")
          local throwstrengh = weapon:get_prop("m_flThrowStrength")
          
          if(weapon:get_weapon_data().type ~= e_weapon_types.GRENADE) then return end
          if(self.should_throw == true) then
            pUserCmd.buttons = bit.bor(pUserCmd.buttons, 1)
            if cock then
               engine.execute_cmd("-duck")
               cock = false
            end
            engine.execute_cmd("-duck")
               if(self.closest_nade.duck == true and duckamount ~= 1.0) then return end
               if(self.closest_nade.duck == false and duckamount ~= 0.0) then return end
               if(self.closest_nade.strength ~= 1.0 and throwstrengh > self.closest_nade.strength) then pUserCmd.buttons = bit.bor(pUserCmd.buttons, 2048); pUserCmd.buttons = bit.band(pUserCmd.buttons, bit.bnot(1)); return end
               if(throwstrengh < self.closest_nade.strength) then pUserCmd.buttons = bit.bor(pUserCmd.buttons, 1) end
               if(self.run_tick == 0) then self.run_tick = pUserCmd.tick_count end
               if(self.closest_nade.runduration > 0 and self.force_forward == false) then
                    local speedfactor = 1.0
                    if(self.closest_nade.duck) then speedfactor = 2.93 end
                    if nade_create then penis = 1 else penis = 0 end
                    local movedirection = pUserCmd.viewangles.yaw - (self.closest_nade.ang.y + self.movedirections[math.max(self.closest_nade.movedirection - penis, 0)])
                    local move = angle_to_vector(angle_t(0, movedirection, 0))
                    pUserCmd.forwardmove = (move.x) * (self.closest_nade.speed * speedfactor)
                    pUserCmd.sidemove = (move.y) * (self.closest_nade.speed * speedfactor)
               end
               if(pUserCmd.tick_count - self.run_tick >= self.closest_nade.runduration) then
                if cock1 then
                    engine.execute_cmd("-duck")
                    cock1 = false
                 end
                    if(self.jump_tick == 0) then self.jump_tick = pUserCmd.tick_count end
                    if(self.closest_nade.jump and self.closest_nade.jumpthresthold <= 0) then
                        pUserCmd.buttons = bit.bor(pUserCmd.buttons, 2)
                    end
                    if(pUserCmd.tick_count - self.jump_tick >= self.closest_nade.jumpduration or self.closest_nade.jumpthresthold > 0) then
                        pUserCmd.buttons = bit.band(pUserCmd.buttons, bit.bnot(1))
                        pUserCmd.buttons = bit.band(pUserCmd.buttons, bit.bnot(2048))
                        pUserCmd.viewangles.pitch, pUserCmd.viewangles.yaw = self.closest_nade.ang.x, self.closest_nade.ang.y
                         self.force_forward = self.closest_nade.extendforward
                    end
                    if(self.closest_nade.jumpthresthold > 0 and pUserCmd.tick_count - self.jump_tick >= self.closest_nade.jumpthresthold) then
                        pUserCmd.buttons = bit.bor(pUserCmd.buttons, 2)
                    end
               end
               if(throwtime > 0.0 and throwtime < global_vars.cur_time()) then
                    self:setup_backup_strafe(cmd)
                    self.closest_nade = nil
                    self.closest_nade_position = nil
                    self.should_throw = false
                    self.run_tick = 0
                    self.jump_tick = 0
                    self.force_forward = false
                    menu_elements.autostrafe[2]:set(self.old_autostrafe)
                    engine.execute_cmd("-duck")
                    --FakeLag.ForceSend()
               end
          elseif(self.closest_nade_position and lua_elements.nade_helper:get() == true) then
            pUserCmd.buttons = bit.band(pUserCmd.buttons, bit.bnot(2048))
               local origin = localplayer:get_render_origin()
               local onground = (bit.band(localplayer:get_prop("m_fFlags"), 1) == 1)
               local delta = (self.closest_nade_position - origin)
               local length = #delta
               if(onground == true and length < 100.0) then
                    local viewangles = engine.get_view_angles()
                    local direction = vector_to_angle(delta)
                    direction.y = viewangles.y - direction.y
                    local move = angle_to_vector(direction)
                    local v1 = bit.band(pUserCmd.buttons, 8) == 8
                    local v2 = bit.band(pUserCmd.buttons, 16) == 16
                    local v3 = bit.band(pUserCmd.buttons, 512) == 512
                    local v4 = bit.band(pUserCmd.buttons, 1024) == 1024
                    local in_duck = bit.band(pUserCmd.buttons, 4) == 4
                    local in_move = (v1 or v2 or v3 or v4)

                    if(in_move == false and length > 0.1) then
                        pUserCmd.forwardmove = move.x * (450.0 * (math.exp(math_helpers:clamp(length, 0.0, 5.0) - 5.0)) + 1.0)
                        pUserCmd.sidemove = move.y * (450.0 * (math.exp(math_helpers:clamp(length, 0.0, 5.0) - 5.0)) + 1.0)
                        if(in_duck == true) then
                            pUserCmd.forwardmove = pUserCmd.forwardmove * 2.93
                            pUserCmd.sidemove = pUserCmd.sidemove * 2.93
                        end
                    elseif(weapon:get_prop("m_bPinPulled") ~= 0 and self.closest_nade and vector_length_2d(velocity) < 10.0) then
                         self.should_throw = true
                         engine.execute_cmd("+duck")
                         self.old_autostrafe = menu_elements.autostrafe[2]:get()
                         menu_elements.autostrafe[2]:set(false)
                    end
               end
            else
                cock = true
                cock1 = true
          end
     end,
}

