     local build_tag = function(tag)
          local ret = {' '}

          for i = 1, #tag do
            table.insert(ret, tag:sub(1, i))
          end

          for i = #ret - 1, 1, -1 do
            table.insert(ret, ret[i])
          end

          return ret
     end

     local tag = build_tag('Made by the chernobyl team  ')

     local function clantag()
          local latency = 20 / global_vars.interval_per_tick()
          local tickcount_pred = global_vars.tick_count() + latency
          local iter = math.floor(math.fmod(tickcount_pred / 24, #tag + 1) + 1)
          if tag[iter] == nil then return end
          lable:set(tag[iter])
     end
     callbacks.add(e_callbacks.PAINT, clantag)
end

