     if entity_list.get_local_player() == nil then return end
     if(lua_elements.run_direction:get() > 1) then
          lua_elements.extend_forward_strenght:set_visible(true)
     else
          lua_elements.extend_forward_strenght:set_visible(false)
     end
end

